const Blogs = ({ persons, title, deleter }) => {
  return (
    <div className="blog-list">
      <h2>{title}</h2>
      {persons.map((person) => (
        <div className="blog-preview" key={person.id}>
          <h1>
            {person.name} with {person.age} years old
          </h1>
          <p>
            {person.gender} livin {person.city}
          </p>
          <p>
            Is {person.gender} native american? {person.nativeAmerican}
          </p>
          <button
            type="button"
            onClick={() => {
              deleter(person.id);
            }}
          >
            REMOVE
          </button>
        </div>
      ))}
    </div>
  );
};

export default Blogs;
